        /* 顶部导航栏 */
        .header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 10px 20px;
            background-color: #0f0f0f;
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            z-index: 100;
        }

        .header-left {
            display: flex;
            align-items: center;
            gap: 15px;
        }

        .menu-icon {
            font-size: 24px;
            cursor: pointer;
            padding: 5px;
        }

        .logo {
            display: flex;
            align-items: center;
            gap: 5px;
            font-size: 20px;
            font-weight: bold;
            letter-spacing: -2px;
        }

        .logo-icon {
            width: 30px;
            height: 20px;
            background: linear-gradient(135deg, #ff0000 0%, #cc0000 100%);
            border-radius: 5px;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .logo-icon::after {
            content: '▶';
            color: white;
            font-size: 12px;
        }

        .header-center {
            flex: 1;
            max-width: 600px;
            margin: 0 30px;
        }

        .search-box {
            display: flex;
            align-items: center;
        }

        .search-input {
            flex: 1;
            padding: 10px 15px;
            background-color: #121212;
            border: 1px solid #303030;
            border-radius: 20px 0 0 20px;
