            border-color: #1a73e8;
        }

        .search-btn {
            padding: 10px 20px;
            background-color: #222222;
            border: 1px solid #303030;
            border-left: none;
            border-radius: 0 20px 20px 0;
            color: white;
            cursor: pointer;
        }

        .search-btn:hover {
            background-color: #303030;
        }

        .mic-btn {
            margin-left: 15px;
            padding: 10px;
            background-color: #181818;
            border: none;
            border-radius: 50%;
            color: white;
            cursor: pointer;
        }

        .header-right {
