            align-items: center;
            justify-content: center;
            font-weight: bold;
            font-size: 14px;
        }

        /* 主容器 */
        .main-container {
            display: flex;
            margin-top: 60px;
        }

        /* 侧边栏 */
        .sidebar {
            width: 240px;
            background-color: #0f0f0f;
            padding: 10px;
            position: fixed;
            left: 0;
            top: 60px;
            bottom: 0;
            overflow-y: auto;
        }

        .sidebar-item {
            display: flex;
            align-items: center;
            padding: 10px 15px;
            border-radius: 10px;
            cursor: pointer;
            margin-bottom: 5px;
        }

        .sidebar-item:hover {
            background-color: #272727;
        }

        .sidebar-item.active {
            background-color: #272727;
        }

        .sidebar-icon {
            font-size: 20px;
            margin-right: 20px;
        }

        .sidebar-text {
            font-size: 14px;
        }

        .sidebar-divider {
            height: 1px;
            background-color: #303030;
            margin: 15px 0;
        }

        /* 内容区域 */
        .content {
            flex: 1;
            margin-left: 240px;
            padding: 20px;
        }

        /* 分类标签 */
        .categories {
            display: flex;
            gap: 10px;
            overflow-x: auto;
            padding: 10px 0;
            margin-bottom: 20px;
        }

        .category-chip {
            padding: 8px 16px;
            background-color: #272727;
            border: none;
            border-radius: 8px;
            color: white;
            font-size: 14px;
            cursor: pointer;
            white-space: nowrap;
        }

        .category-chip:hover {
            background-color: #3f3f3f;
        }

        .category-chip.active {
            background-color: white;
            color: black;
        }

        /* 视频网格 */
        .video-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(320px, 1fr));
            gap: 20px;
        }

        .video-card {
            cursor: pointer;
        }

        .video-thumbnail {
            width: 100%;
            height: 180px;
            background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
            border-radius: 12px;
            position: relative;
            overflow: hidden;
        }

        .video-duration {
            position: absolute;
            bottom: 8px;
            right: 8px;
            background-color: rgba(0, 0, 0, 0.8);
            padding: 3px 6px;
            border-radius: 4px;
            font-size: 12px;
        }

        .video-info {
            display: flex;
            gap: 12px;
            margin-top: 12px;
        }

        .channel-avatar {
            width: 36px;
            height: 36px;
            border-radius: 50%;
            background: linear-gradient(135deg, #f093fb 0%, #f5576c 100%);
