        }

        .video-title {
            font-size: 14px;
            font-weight: 500;
            margin-bottom: 5px;
            line-height: 1.4;
            display: -webkit-box;
            -webkit-line-clamp: 2;
            -webkit-box-orient: vertical;
            overflow: hidden;
        }

        .channel-name {
            font-size: 12px;
            color: #aaaaaa;
            margin-bottom: 3px;
        }

        .video-meta {
            font-size: 12px;
            color: #aaaaaa;
        }

        /* 滚动条样式 */
        ::-webkit-scrollbar {
            width: 8px;
            height: 8px;
        }

