这个 YouTube 首页克隆包含了：

- **顶部导航栏**：菜单图标、YouTube logo、搜索框、语音输入按钮和用户图标
- **侧边栏**：包含首页、Shorts、订阅、历史记录等导航选项
- **分类标签**：可横向滚动的视频分类
- **视频网格**：响应式布局，显示视频缩略图、标题、频道信息和观看数据
- **深色主题**：符合 YouTube 的深色模式设计
- **响应式设计**：视频卡片会根据屏幕宽度自动调整布局

